package utils;import lombok.Data;import org.testng.annotations.DataProvider;import java.io.IOException;public class DataProviders {    @DataProvider(name = "registerInfo")    public static Object[][] getTestData() throws IOException {        String path = System.getProperty("user.dir") + "/src/test/resources/test data/Register data.xlsx";        String sheetName = "RegisterInfo";        return new ExcelUtility(path).getTestData(path, sheetName);    }    @DataProvider(name = "loginInfo")    public static Object[][] getLoginTestData() throws IOException {        String path = System.getProperty("user.dir") + "/src/test/resources/test data/Register data.xlsx";        String sheetName = "Login";        return new ExcelUtility(path).getTestData(path, sheetName);    }}